snippet.description:
In risposta al mio video del 2022 in cui mi chiedevo se Nintendo non si vergognasse di presentare - seppur indirettamente, perché lo sappiamo tutti che il gioco è di Game Freak - un gioco come Pokémon sempre con difetti importanti, gameplay solo di poco affinato, di volta in volta, e un comparto tecnico deficitario, ora, con l'uscita di Leggende Pokémon Z-A, cerchiamo di capirci qualcosa. Se ci riusciamo.

0:00 - Introduzione e premesse;
0:46 - Il lancio di Leggende Pokémon Z-A: "perché lo compriamo ancora?"
2:14 - Leggende Pokémon Z-A: un disastro tecnico, o quasi;
2:38 - Le scuse per Game Freak: un problema "umano";
3:57 - "Vi impegnereste di più pur sapendo di fare massima resa con minima spesa?"
6:52 - Leggende Pokémon Z-A peggio di Scarlatto e Violetto? Forse sì, in proporzione;
9:02 - Quella volta in cui facemmo la punta al ca**o a Bananza e Tears of the Kingdom;
9:47 - "Ma tanto è Pokémon, è per bambini e la grafica non conta". Di nuovo;
10:17 - "Ma il gameplay è innovativo". No?
12:11 - "I giochi Pokémon non li potete capire se avete il PC con i led colorati";
13:00 - Qual è la fanbase, il target di Pokémon?
14:01 - "Non ho risposte semplici" (cit.);

